import React from 'react';

const TodoItem = ({ todo, onDelete, onToggleComplete }) => {
  return (
    <li>
      <input
        type="checkbox"
        checked={todo.completed}
        onChange={onToggleComplete}
      />
      {todo.text}
      <button onClick={onDelete}>Delete</button>
    </li>
  );
};

export default TodoItem;
